import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
  const [context, setContext] = useState({});

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/my_context/')
      .then(response => setContext(response.data.context))
      .catch(error => console.error('Error fetching context:', error));
  }, []);

  return (
    <div>
      <h1>Home Page</h1>
      <p>{context.my_text}</p>
    </div>
  );
};

export default Home;
